  \"2015-09-26T22:16:18.597215\",\n\t\"name\": \"2004-st-johns-county-florida-lidar\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is the bare earth lidar data
  for St. Johns County, Florida, acquired in early January and February of 2004. This
  data was collected to develop comprehensive countywide base mapping and perform
  other GIS enhancements to support master drainage planning, transportation planning,
  preliminary engineering and wetland preservation studies. The surveyed area included
  all of St. Johns County, approximately 610 square miles. Eighty-seven (87) flight
  lines of high density lidar data (average GSD is 3.3 feet) were obtained at an altitude
  of 3000 feet AGL. This data set contains only model keypoints (points that are a
  thinned data set that is intended to remove extraneous data such as trees and points
  that are deemed redundant to the final bare earth product) that are classified as
  ground points. As a result, there are a lower number of points than in a full mass
  point lidar data set; and it is recommended that the data be downloaded as points
  and used with a TIN (Triangulated Irregular Network) or similar algorithm to produce
  a bare earth surface.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
